import React, { PureComponent } from 'react'

import Outer from './styled/Outer'
import { prependOnceListener } from 'cluster';

export default class Container extends PureComponent{
    render(){
        return(
            <Outer id="container">
                {this.props.children}
            </Outer>
        )
    }
}
